<h1 class="c12 c31">
    <span class="c2 c11">T.C.</span>
</h1>
<h1 class="c12 c31">
    <span class="c11 c2">FIRAT &Uuml;N&#304;VERS&#304;TES&#304;</span>
</h1>
<p class="c41">
    <span class="c2">FEN B&#304;L&#304;MLER&#304; ENST&#304;T&Uuml;S&Uuml;</span>
</p>
<h5 class="c12 c31">
    <span class="c11 c7 c36">F&#304;K&#304;R HAK SAH&#304;PL&#304;&#286;&#304; BEYANI</span>
</h5>
<a id="t.7e84e4a38c1fbe4fa00053b4bdc2b3283dbfbbf1"></a>
<a id="t.0"></a>
<table class="c52">
    <tbody>
    <tr class="c49">
        <td class="c47" colspan="2" rowspan="1">
            <p class="c0 c21">
                <span class="c1"></span>
            </p>
        </td>
    </tr>
    <tr class="c35">
        <td class="c51" colspan="2" rowspan="1">
            <p class="c19">
                <span class="c11 c2">GEREK&Ccedil;E:</span>
            </p>
            <p class="c38">
                <span class="c26">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>
                <span class="c1">5846 say&#305;l&#305; Fikir ve Sanat Eserleri Kanunu&rsquo;nun 1/B Maddesinde &lsquo;Eser&rsquo; tan&#305;m&#305; yap&#305;lm&#305;&#351; olup, her nevi fikir ve sanat mahsullerini kapsamaktad&#305;r. An&#305;lan kanunun 2. Maddesinin 3. F&#305;kras&#305;nda ve 50. Maddesinde de eserlerin v&uuml;cuda getirilmeden &ouml;nceki tasar&#305;m a&#351;amas&#305;n&#305;n da &lsquo;eser&rsquo; niteli&#287;inde oldu&#287;u yap&#305;lacak s&ouml;zle&#351;melerin muteber oldu&#287;u belirtilir. &nbsp; &nbsp;</span>
            </p>
            <p class="c30">
                <span class="c10">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;An&#305;lan Kanunun 9., 10. ve 50. Maddeleri uyar&#305;nca birden fazla kimsenin i&#351;tiraki ile v&uuml;cuda getirilen eser, ayr&#305;lmaz bir b&uuml;t&uuml;n te&#351;kil ediyorsa bir s&ouml;zle&#351;me ile hak sahipli&#287;i oranlar&#305; beyan edilmelidir. Buna g&ouml;re, Tez &Ouml;nerisi Formunu imzalayan taraflar&#305;n </span>
                <span class="c10 c13">(Tez Dan&#305;&#351;man&#305; ve &Ouml;&#287;renci) </span>
                <span class="c10">Tez Konusu &Ouml;nerisi i&ccedil;inde yaz&#305;l&#305; fikirler &uuml;zerinde Ortak Hak Sahipli&#287;i, Payl&#305; Hak Sahipli&#287;i</span>
                <span class="c2">&nbsp;</span>
                <span class="c10">veya</span>
                <span class="c2">&nbsp;</span>
                <span class="c10">Hak Sahipli&#287;i Feragat</span>
                <span class="c2">&nbsp;</span>
                <span class="c10">beyan&#305;nda bulunmalar&#305; gereklidir.</span>
                <span class="c11 c2">&nbsp;</span>
            </p>
            <ul class="c50 lst-kix_list_26-0 start">
                <li class="c5">
                    <span class="c6 c13">Tez &Ouml;nerisi b&ouml;l&uuml;mleri fikri haklar a&ccedil;&#305;s&#305;ndan paylara ayr&#305;lamad&#305;&#287;&#305; hallerde </span>
                    <span class="c3 c13">ortak </span>
                    <span class="c6 c13">(e&#351;it dereceli haklar), ayr&#305;labiliyor ise </span>
                    <span class="c3 c13">payl&#305;</span>
                    <span class="c6 c13">&nbsp;fikri hak sahipli&#287;i tercih edilmelidir. &nbsp;</span>
                </li>
                <li class="c13 c24">
                    <span class="c6 c13">Payl&#305; Hak Sahipli&#287;i se&ccedil;ilmesi halinde bu Forma ek olarak paylar&#305; (oranlar&#305;) tan&#305;mlayacak &#351;ekilde &lsquo;Payl&#305; Hak Sahipli&#287;i Beyan&#305;&rsquo; haz&#305;rlanmal&#305; ve imzalanmal&#305;d&#305;r.</span>
                </li>
            </ul>
            <p class="c45">
                <span class="c7 c18">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>
                <span class="c7 c8">BEYAN:</span>
                <span class="c7 c15">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; .</span>
            </p>
            <p class="c13 c29" id="h.gjdgxs">
                <span class="c7">&#9744; &nbsp; &nbsp;</span>
                <span class="c26">Tez Konusu &Ouml;nerisinde </span>
                <span class="c7">ORTAK HAK SAH&#304;PL&#304;&#286;&#304; vard&#305;r.</span>
            </p>
            <p class="c14">
                <span class="c7">&#9744; &nbsp; &nbsp;</span>
